    false,nt"url": null,nt"notes": "This narrative report for Lacreek National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1948. The report begins by summarizing the weather conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, furbearers, predators, rodents, raptors, fish, and reptiles- is also
    covered. The Refuge development and maintenance section discusses physical developments,
    plantings, and wildfires. Resource management is outlined; topics include grazing
    and fur harvesting. A progress report on field investigations and applied research
    is also provided. The public relations section of the report describes recreational
    uses, Refuge visitors, and hunting. N-R forms are attached.",nt"owner_org":
